You could go with a uniform, large eyes and nose shape on each chair or go for something more intricate. Scan the Internet for a design you desire. You don't necessarily need the large design to fit the chair right now. Instead find something that not only you like, but one you know you can cut out on the chair. {"smallUrl":"https://www.wikihow.com/images/thumb/4/44/Design-a-Skull-Patio-Chair-Step-1Bullet1.jpg/v4-460px-Design-a-Skull-Patio-Chair-Step-1Bullet1.jpg","bigUrl":"https://www.wikihow.com/images/thumb/4/44/Design-a-Skull-Patio-Chair-Step-1Bullet1.jpg/v4-760px-Design-a-Skull-Patio-Chair-Step-1Bullet1.jpg","smallWidth":460,"smallHeight":345,"bigWidth":760,"bigHeight":570,"licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
</p><p><br />
</p></div>"}

Look for designs that emphasize the skull shape and not color or fine lines. You will need a basic design that can be translated to your plastic chairs. {"smallUrl":"https://www.wikihow.com/images/thumb/d/d8/Design-a-Skull-Patio-Chair-Step-1Bullet2.jpg/v4-460px-Design-a-Skull-Patio-Chair-Step-1Bullet2.jpg","bigUrl":"https://www.wikihow.com/images/thumb/d/d8/Design-a-Skull-Patio-Chair-Step-1Bullet2.jpg/v4-760px-Design-a-Skull-Patio-Chair-Step-1Bullet2.jpg","smallWidth":460,"smallHeight":345,"bigWidth":760,"bigHeight":570,"licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
</p><p><br />
</p></div>"}

Light plastic chairs will move around when you are cutting so securing the chair is vital to making this a success. Weigh down the legs with bricks or rocks if your chairs have feet. You can also push the chair up against the wall to make sure it doesn't tip over. {"smallUrl":"https://www.wikihow.com/images/thumb/3/39/Design-a-Skull-Patio-Chair-Step-4Bullet1.jpg/v4-460px-Design-a-Skull-Patio-Chair-Step-4Bullet1.jpg","bigUrl":"https://www.wikihow.com/images/thumb/3/39/Design-a-Skull-Patio-Chair-Step-4Bullet1.jpg/v4-760px-Design-a-Skull-Patio-Chair-Step-4Bullet1.jpg","smallWidth":460,"smallHeight":345,"bigWidth":760,"bigHeight":570,"licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
</p><p><br />
</p></div>"}

Weigh down the chair seat to keep the chair in place. If your chair doesn't have feet you can also keep the chair in place by placing weight on the seat. {"smallUrl":"https://www.wikihow.com/images/thumb/f/fe/Design-a-Skull-Patio-Chair-Step-4Bullet2.jpg/v4-460px-Design-a-Skull-Patio-Chair-Step-4Bullet2.jpg","bigUrl":"https://www.wikihow.com/images/thumb/f/fe/Design-a-Skull-Patio-Chair-Step-4Bullet2.jpg/v4-760px-Design-a-Skull-Patio-Chair-Step-4Bullet2.jpg","smallWidth":460,"smallHeight":345,"bigWidth":760,"bigHeight":570,"licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
</p><p><br />
</p></div>"}

Depending on the size of your design and chair you should size up what you will be cutting to match up the right blade. Make sure your hand saw equipment is up to par. You don't want to approach this project with a dull blade so make sure you are working with a sharp blade and a hand saw that works well. {"smallUrl":"https://www.wikihow.com/images/thumb/0/0a/Design-a-Skull-Patio-Chair-Step-8Bullet1.jpg/v4-460px-Design-a-Skull-Patio-Chair-Step-8Bullet1.jpg","bigUrl":"https://www.wikihow.com/images/thumb/0/0a/Design-a-Skull-Patio-Chair-Step-8Bullet1.jpg/v4-760px-Design-a-Skull-Patio-Chair-Step-8Bullet1.jpg","smallWidth":460,"smallHeight":345,"bigWidth":760,"bigHeight":570,"licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
</p><p><br />
</p></div>"}

Select a slow cutting speed. You may be excited about creating the design but a fast speed could make you more prone to errors. {"smallUrl":"https://www.wikihow.com/images/thumb/6/66/Design-a-Skull-Patio-Chair-Step-8Bullet2.jpg/v4-460px-Design-a-Skull-Patio-Chair-Step-8Bullet2.jpg","bigUrl":"https://www.wikihow.com/images/thumb/6/66/Design-a-Skull-Patio-Chair-Step-8Bullet2.jpg/v4-760px-Design-a-Skull-Patio-Chair-Step-8Bullet2.jpg","smallWidth":460,"smallHeight":345,"bigWidth":760,"bigHeight":570,"licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
